    state.inputStyle={borderColor: 'green'}
}
    return(
        <>
        <PinInput 
        length={5} 
        focus
        value = {state}
        onChange={(e)=>{setState(e.value)} }
        type="text" 
        inputMode="text"
        style={{padding: '10px'}}  
        inputStyle={{borderColor: 'red'}}
        inputFocusStyle={{borderColor: 'blue'}}
        onComplete={handlecComplete}


        >
        terjg

        </PinInput>

        </>
    )
}

